{name:"results.md"},r=t(`<h1 id="understanding-load-test-results" tabindex="-1">Understanding Load Test Results <a class="header-anchor" href="#understanding-load-test-results" aria-hidden="true">#</a></h1><p>This page explains how to interpret the results reported by Load-Pulse after a test run completes.</p><h2 id="overview" tabindex="-1">Overview <a class="header-anchor" href="#overview" aria-hidden="true">#</a></h2><p>When a load test completes, Load-Pulse aggregates statistics from all worker nodes and displays a summary for each endpoint tested. The results are printed to the console and include key performance metrics.</p><h2 id="result-format" tabindex="-1">Result Format <a class="header-anchor" href="#result-format" aria-hidden="true">#</a></h2><p>Results are displayed in a formatted output with colored text for better readability. Each endpoint gets its own statistics block:</p><div class="language-"><button title="Copy Code" class="copy"></button><span class="lang"></span><pre class="shiki"><code><span class="line"><span style="color:#A6ACCD;">[LOG]: Test completed for endpoint: /api/users</span></span>
<span class="line"><span style="color:#A6ACCD;">------------------------------ STATS --------------------------------</span></span>
<span class="line"><span style="color:#A6ACCD;">[STATS]: Total requests completed: 1000</span></span>
<span class="line"><span style="color:#A6ACCD;">[STATS]: Total Number of Error Requests: 5</span></span>
<span class="line"><span style="color:#A6ACCD;">[STATS]: Average response size: 1024.5 bytes</span></span>
<span class="line"><span style="color:#A6ACCD;">[STATS]: Min response time: 45ms</span></span>
<span class="line"><span style="color:#A6ACCD;">[STATS]: Max response time: 1250ms</span></span>
<span class="line"><span style="color:#A6ACCD;">[STATS]: Average response time: 234ms</span></span>
<span class="line"><span style="color:#A6ACCD;">---------------------------------------------------------------------</span></span>
<span class="line"><span style="color:#A6ACCD;"></span></span></code></pre></div><h2 id="metrics-explained" tabindex="-1">Metrics Explained <a class="header-anchor" href="#metrics-explained" aria-hidden="true">#</a></h2><h3 id="total-requests-completed" tabindex="-1">Total Requests Completed <a class="header-anchor" href="#total-requests-completed" aria-hidden="true">#</a></h3><p><strong>What it means:</strong> The total number of HTTP requests that were sent during the test run for this endpoint.</p><p><strong>What to look for:</strong></p><ul><li>Compare this number to your expected request count based on duration, rate, and connections</li><li>A significantly lower number might indicate the test ended early or requests were throttled</li></ul><p><strong>Example:</strong></p><div class="language-"><button title="Copy Code" class="copy"></button><span class="lang"></span><pre class="shiki"><code><span class="line"><span style="color:#A6ACCD;">[STATS]: Total requests completed: 1000</span></span>
<span class="line"><span style="color:#A6ACCD;"></span></span></code></pre></div><h3 id="total-number-of-error-requests" tabindex="-1">Total Number of Error Requests <a class="header-anchor" href="#total-number-of-error-requests" aria-hidden="true">#</a></h3><p><strong>What it means:</strong> The count of requests that failed (network errors, timeouts, HTTP error status codes, etc.).</p><p><strong>What to look for:</strong></p><ul><li><strong>Low error rate (0-1%):</strong> Generally acceptable for most applications</li><li><strong>Moderate error rate (1-5%):</strong> May indicate occasional issues under load</li><li><strong>High error rate (&gt;5%):</strong> Suggests the server is struggling under load or there are configuration issues</li></ul><p><strong>Example:</strong></p><div class="language-"><button title="Copy Code" class="copy"></button><span class="lang"></span><pre class="shiki"><code><span class="line"><span style="color:#A6ACCD;">[STATS]: Total Number of Error Requests: 5</span></span>
<span class="line"><span style="color:#A6ACCD;"></span></span></code></pre></div><p><strong>Success rate calculation:</strong></p><div class="language-"><button title="Copy Code" class="copy"></button><span class="lang"></span><pre class="shiki"><code><span class="line"><span style="color:#A6ACCD;">Success Rate = (Total Requests - Error Requests) / Total Requests \xD7 100%</span></span>
<span class="line"><span style="color:#A6ACCD;"></span></span></code></pre></div><h3 id="average-response-size" tabindex="-1">Average Response Size <a class="header-anchor" href="#average-response-size" aria-hidden="true">#</a></h3><p><strong>What it means:</strong> The average size (in bytes) of successful HTTP response bodies received.</p><p><strong>What to look for:</strong></p><ul><li>Helps understand data transfer requirements</li><li>Larger response sizes may impact network bandwidth and response times</li><li>Useful for capacity planning</li></ul><p><strong>Example:</strong></p><div class="language-"><button title="Copy Code" class="copy"></button><span class="lang"></span><pre class="shiki"><code><span class="line"><span style="color:#A6ACCD;">[STATS]: Average response size: 1024.5 bytes</span></span>
<span class="line"><span style="color:#A6ACCD;"></span></span></code></pre></div><h3 id="min-response-time" tabindex="-1">Min Response Time <a class="header-anchor" href="#min-response-time" aria-hidden="true">#</a></h3><p><strong>What it means:</strong> The fastest response time recorded for any single request during the test.</p><p><strong>What to look for:</strong></p><ul><li>Represents the best-case performance</li><li>Useful for understanding baseline performance without load</li><li>Compare with average response time to see variance</li></ul><p><strong>Example:</strong></p><div class="language-"><button title="Copy Code" class="copy"></button><span class="lang"></span><pre class="shiki"><code><span class="line"><span style="color:#A6ACCD;">[STATS]: Min response time: 45ms</span></span>
<span class="line"><span style="color:#A6ACCD;"></span></span></code></pre></div><h3 id="max-response-time" tabindex="-1">Max Response Time <a class="header-anchor" href="#max-response-time" aria-hidden="true">#</a></h3><p><strong>What it means:</strong> The slowest response time recorded for any single request during the test.</p><p><strong>What to look for:</strong></p><ul><li>Represents worst-case performance</li><li>Large gaps between min and max indicate inconsistent performance</li><li>Helps identify performance bottlenecks or timeout issues</li></ul><p><strong>Example:</strong></p><div class="language-"><button title="Copy Code" class="copy"></button><span class="lang"></span><pre class="shiki"><code><span class="line"><span style="color:#A6ACCD;">[STATS]: Max response time: 1250ms</span></span>
<span class="line"><span style="color:#A6ACCD;"></span></span></code></pre></div><h3 id="average-response-time" tabindex="-1">Average Response Time <a class="header-anchor" href="#average-response-time" aria-hidden="true">#</a></h3><p><strong>What it means:</strong> The mean response time across all successful requests for this endpoint.</p><p><strong>What to look for:</strong></p><ul><li><strong>Primary performance indicator</strong> \u2013 most important metric for understanding typical user experience</li><li>Compare against your SLA or performance requirements</li><li>Consider percentiles (if available) for more detailed analysis</li></ul><p><strong>Example:</strong></p><div class="language-"><button title="Copy Code" class="copy"></button><span class="lang"></span><pre class="shiki"><code><span class="line"><span style="color:#A6ACCD;">[STATS]: Average response time: 234ms</span></span>
<span class="line"><span style="color:#A6ACCD;"></span></span></code></pre></div><h2 id="interpreting-results" tabindex="-1">Interpreting Results <a class="header-anchor" href="#interpreting-results" aria-hidden="true">#</a></h2><h3 id="good-performance-indicators" tabindex="-1">Good Performance Indicators <a class="header-anchor" href="#good-performance-indicators" aria-hidden="true">#</a></h3><p><strong>Low average response time</strong> relative to your requirements<br><strong>Low error rate</strong> (&lt; 1%)<br><strong>Consistent response times</strong> (small gap between min and max)<br><strong>High request completion rate</strong> matching expected load</p><h3 id="warning-signs" tabindex="-1">Warning Signs <a class="header-anchor" href="#warning-signs" aria-hidden="true">#</a></h3><p><strong>High error rate</strong> (&gt; 5%) \u2013 Server may be overloaded or misconfigured<br><strong>Large variance</strong> between min and max response times \u2013 Inconsistent performance<br><strong>Very high max response time</strong> \u2013 Possible timeouts or bottlenecks<br><strong>Lower than expected request count</strong> \u2013 Test may have been throttled or ended early</p><h3 id="performance-analysis-tips" tabindex="-1">Performance Analysis Tips <a class="header-anchor" href="#performance-analysis-tips" aria-hidden="true">#</a></h3><ol><li><strong>Compare endpoints:</strong> Different endpoints may have different performance characteristics</li><li><strong>Consider load:</strong> Response times typically increase with higher concurrency</li><li><strong>Check error patterns:</strong> Are errors concentrated at certain times or evenly distributed?</li><li><strong>Review configuration:</strong> Ensure your test configuration matches real-world usage patterns</li></ol><h2 id="example-analysis" tabindex="-1">Example Analysis <a class="header-anchor" href="#example-analysis" aria-hidden="true">#</a></h2><p>Given these results:</p><div class="language-"><button title="Copy Code" class="copy"></button><span class="lang"></span><pre class="shiki"><code><span class="line"><span style="color:#A6ACCD;">[STATS]: Total requests completed: 1000</span></span>
<span class="line"><span style="color:#A6ACCD;">[STATS]: Total Number of Error Requests: 2</span></span>
<span class="line"><span style="color:#A6ACCD;">[STATS]: Average response size: 2048 bytes</span></span>
<span class="line"><span style="color:#A6ACCD;">[STATS]: Min response time: 50ms</span></span>
<span class="line"><span style="color:#A6ACCD;">[STATS]: Max response time: 500ms</span></span>
<span class="line"><span style="color:#A6ACCD;">[STATS]: Average response time: 150ms</span></span>
<span class="line"><span style="color:#A6ACCD;"></span></span></code></pre></div><p><strong>Analysis:</strong></p><ul><li><strong>Success rate:</strong> 99.8% (998/1000) \u2013 Excellent</li><li><strong>Average response time:</strong> 150ms \u2013 Good for most web APIs</li><li><strong>Consistency:</strong> Max (500ms) is 3.3\xD7 the average, which is reasonable</li><li><strong>Response size:</strong> 2KB average \u2013 Moderate, shouldn&#39;t cause issues</li><li><strong>Overall:</strong> This endpoint is performing well under the tested load</li></ul><h2 id="limitations" tabindex="-1">Limitations <a class="header-anchor" href="#limitations" aria-hidden="true">#</a></h2><p>Current Load-Pulse results include aggregate statistics. For more detailed analysis, consider:</p><ul><li><strong>Percentiles</strong> (p50, p95, p99) \u2013 Not currently reported, but would provide better insight into response time distribution</li><li><strong>Request rate over time</strong> \u2013 Current results show totals, not time-series data</li><li><strong>Per-endpoint breakdowns</strong> \u2013 Results are shown per endpoint, which is helpful for identifying problem areas</li></ul><h2 id="next-steps" tabindex="-1">Next Steps <a class="header-anchor" href="#next-steps" aria-hidden="true">#</a></h2><p>After reviewing your results:</p><ol><li><strong>If performance is good:</strong> Consider testing with higher load or longer duration</li><li><strong>If errors are high:</strong> Check server logs, reduce concurrency, or investigate server capacity</li><li><strong>If response times are high:</strong> Optimize your API, check database queries, or scale your infrastructure</li><li><strong>For more detailed analysis:</strong> Consider integrating Load-Pulse results with monitoring tools or exporting data for further analysis</li></ol><p>For information on configuring your tests, see the <a href="/Load-Pulse/config-reference.html">Config Reference</a> page.</p>`,65),o=[r];function i(l,p,c,d,g,u){return n(),s("div",null,o)}const f=e(a,[["render",i]]);export{m as __pageData,f as default};
